import { BrowserRouter, Routes, Route } from "react-router-dom";
// import { Create,HomeCreate } from "pages"; 
import "./App.css";

function App() {
  return (
    <BrowserRouter>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/form" element={<FormExample />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
